import axios from "axios";

const BASE_URL = "http://127.0.0.1:8000/api";

// Fetch dashboard data
export const fetchDashboardData = async (userType) => {
  try {
    const endpoint = userType === "doctor" ? "dashboard/doctor/" : "dashboard/user/";
    const response = await axios.get(`${BASE_URL}/${endpoint}`, {
      headers: {
        Authorization: `Bearer ${localStorage.getItem("accessToken")}`,
      },
    });
    console.log("Dashboard Data Response:", response.data); // Print the response
    return response.data;
  } catch (error) {
    console.error("Error fetching dashboard data:", error.response?.data || error.message);
    throw error.response?.data || "Failed to fetch dashboard data.";
  }
};

// Fetch doctor profile data
export const fetchDoctorProfile = async (profileId) => {
  try {
    const response = await axios.get(`${BASE_URL}/doctor-profiles/${profileId}/`, {
      headers: {
        Authorization: `Bearer ${localStorage.getItem("accessToken")}`,
        Accept: 'application/json',
      },
    });
    console.log("Doctor Profile Response:", response.data); // Print the response
    return response.data;
  } catch (error) {
    console.error("Error fetching doctor profile:", error.response?.data || error.message);
    throw error.response?.data || "Failed to fetch doctor profile.";
  }
};
